import React, { Component } from 'react';
import './index.css';
import Search from './Search.js';
import ProductsWindow from './ProductsWindow.js';

export default class FilterableProductTable extends Component {

  render(){
        return(
            <div>
                  <Search/>
                  <ProductsWindow 
                        products={this.props.products}
                  />
            </div>
        )
  }


}
